import {View,Text} from "react-native";
import {Ionicons} from "@expo/vector-icons";

function Home(){
    return(<View style={{backgroundColor:"#F1EA12",height:"100%",justifyContent:"center",alignItems:"center"}}>
        <Text style={{fontSize:20,fontWeight:"bold"}}>Home Page</Text>
        <Ionicons name="home" />
    </View>)
};

export default Home;
